В рамках задачи требуется спроектировать API по получению истории изменения атрибутов клиента.

Информация, которая должна возвращаться в рамках события истории, требуется определить и согласовать с командой NUS (Юлия Горовенко).  

При проектировании обязательно проработать следующие вопросы:
 * каким образом возвращать информацию по автору изменения (логин, фио, идентификатор);
 * нужно ли и каким образом возвращать в истории изменения атрибутов клиента информацию по изменению адресов;
 * каким образом в истории изменения атрибутов объекта должны возвращаться дополнительные атрибуты.

*DoD:*
 * подготовлена спецификация API по истории изменения атрибутов клиента на Confluence;
 * подготовлен YAML-файл с описанием API, оформлен MR;
 * API согласовано с командой разработки, командой NUS, и командой OAPI.

